import React from "react";
import './Pageeight.css';
function Pageeight() {
  return (
    <div className="pageeight">
      <div>
        <table style={{ padding: "10px" }}>
          <tr>
            <th>Our Company</th>
            <th>Build Your Team</th>
            <th>Services </th>
            <th>Resources</th>
          </tr>
          <tr>
            <td>About Webure</td>
            <td>How it works</td>
            <td>Seo service</td>
            <td>Blogs</td>
            
          </tr>
        </table>
      </div>
    </div>
  );
}

export default Pageeight;
